No matter where we are, No matter what we are doing,  We support our Troops until they all come home.  Our Troops are deployed all around the world defending the rights and freedoms for not just us, but of people from all walks of life. We Live as a Free People and Country because of their efforts abroad.  They are creating homes and opportunities for what freedom and life should be for Everyone. 
We need to blanket all social media with Red on R.E.D. Friday’s.  It’s easy to show your support for our troops.  Pick something Red from your wardrobe and wear it on Friday.  Use a Red filter over a selfie. Volunteer your time organizing care packages for troops who still need essential items, or write to a deployed troop. 
Our Troops and Families sacrifice so much for us to be a free and prosperous people. Wearing Red is the easiest thing we can do to show our support. 
Remember•Everyone•Deployed. 
